if(window.attachEvent){window.attachEvent("onload",initDialog)}else{if(window.addEventListener){window.addEventListener("load",initDialog,false)}}var ArgList=null;function initDialog(){ArgList=parent.window.getDialogInputArgs();for(var b=0;b<ArgList.length;b++){if(ArgList[b]==null){ArgList[b]=""}}var e=document.getElementById("latitude");var c=document.getElementById("longitude");if(ArgList[0]==""){e.value="latitude";c.value="longitude"}else{var d=ArgList[0].split(";");e.value=d[0];c.value=d[1];var a=document.getElementById("insertButtonID");a.value="Update GPS"}style=ArgList[1]}function insertButton(){var b=document.getElementById("latitude");if(b.value==null||b.value==""){alert("latitude Name is empty");return}var a=document.getElementById("longitude");if(a.value==null||a.value==""){alert("longitude Name is empty");return}if(!IsValidObjectName(b.value)){alert('Latitude Name can only contain either a letter, number, space or "_" and be 1 to 100 characters long');return}if(!IsValidObjectName(a.value)){alert('Longitude Name can only contain either a letter, number, space or "_" and be 1 to 100 characters long');return}b.value=b.value.replaceAll(" ","_");a.value=a.value.replaceAll(" ","_");ArgList[0]=b.value+";"+a.value;ArgList[1]=style;parent.window.InsertGPSCallback(ArgList)};